import React from "react";

const IncludedInvestmentAccounts = ({ fullPage }) => {
  // Dummy data
  const investments = [
    { name: "401(k)", balance: 65000 },
    { name: "Roth IRA", balance: 18000 },
  ];

  return (
    <section
      style={{
        background: "#f3e8ff",
        borderRadius: 12,
        padding: "1.2rem",
        minHeight: 120,
        boxShadow: "0 1px 4px #a78bfa22",
        gridColumn: fullPage ? "1 / -1" : undefined,
      }}
    >
      <h3 style={{ color: "#7c3aed", marginBottom: 8 }}>
        Included Investment Accounts
      </h3>
      <ul style={{ listStyle: "none", padding: 0, margin: 0 }}>
        {investments.map((inv, i) => (
          <li key={i} style={{ marginBottom: 6, color: "#3b0764" }}>
            {inv.name}:{" "}
            <span style={{ color: "#7c3aed", fontWeight: 600 }}>
              ${inv.balance.toLocaleString()}
            </span>
          </li>
        ))}
      </ul>
    </section>
  );
};

export default IncludedInvestmentAccounts;
